package com.naver;

public class Test {

	private String id;
	private int age;
	private boolean c;
	private char d;
	private float e;
	private StringBuffer sb;
	private int[] arr;
	
	public Test() {
		// TODO Auto-generated constructor stub
	}

	public Test(String id, int age, boolean c, char d, float e, StringBuffer sb, int[] arr) {
		super();
		this.id = id;
		this.age = age;
		this.c = c;
		this.d = d;
		this.e = e;
		this.sb = sb;
		this.arr = arr;
	}

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public int getAge() {
		return age;
	}

	public void setAge(int age) {
		this.age = age;
	}

	public boolean isC() {
		return c;
	}

	public void setC(boolean c) {
		this.c = c;
	}

	public char getD() {
		return d;
	}

	public void setD(char d) {
		this.d = d;
	}

	public float getE() {
		return e;
	}

	public void setE(float e) {
		this.e = e;
	}

	public StringBuffer getSb() {
		return sb;
	}

	public void setSb(StringBuffer sb) {
		this.sb = sb;
	}

	public int[] getArr() {
		return arr;
	}

	public void setArr(int[] arr) {
		this.arr = arr;
	}
	
	
	


}
